import React from 'react';
import { IconButton, AppBar, Toolbar, Typography, Button } from '@material-ui/core';
import { MenuIcon } from '@material-ui/icons/Menu';

//image to be displayed on header of Home Page
const Appbar = () => {
    return (
        <AppBar position="static">
            <Toolbar>
                <IconButton edge="start" color="inherit" aria-label="menu">
                    <MenuIcon />
                </IconButton>
                <Typography variant="h6" >
                    BECOMING BUSINESSWOMEN
                </Typography>
                <Button color="inherit">HOME</Button>
                <Button color="inherit">ABOUT US</Button>
                <Button color="inherit">OUR TEAM</Button>
                <Button color="inherit">JOIN US</Button>
                <Button color="inherit">CONTACT</Button>
            </Toolbar>
        </AppBar>
    )
}

export default Appbar
